import React from "react";
import SkillArray from "../../json/skill.json";

export default function Skill() {
  return (
    <div className="Skill Section__spacing">
      <div className="Title">
        <h4>Skills</h4>
      </div>

      <div className="Skill__content">
        {SkillArray &&
          SkillArray.map((Skill, index) => (
            <div className="Skill__list" key={Skill.id}>
              <span className="Skill__title">{Skill.catalogue}</span>
              <ul>
                {Skill.list &&
                  Skill.list.map((Catalogue, index) => (
                    <li key={Catalogue.id}>
                      <img src={Catalogue.img_url} alt={Catalogue.name} />
                    </li>
                  ))}
              </ul>
            </div>
          ))}
      </div>
    </div>
  );
}
